document.getElementById('addBtn').addEventListener('click', function() {
    const inputField = document.getElementById('input');
    const taskText = inputField.value;

    if (taskText.trim() !== "") {
        // Create a new task container
        const newTask = document.createElement('div');
        newTask.classList.add('todoItem');

        // Create the item content element
        const itemContent = document.createElement('div');
        itemContent.classList.add('itemContent');
        itemContent.textContent = taskText;

        // Create the delete button element
        const deleteBtn = document.createElement('button');
        deleteBtn.classList.add('deleteBtn');
        deleteBtn.textContent = "Delete";

        // Append the item content and delete button to the task container
        newTask.appendChild(itemContent);
        newTask.appendChild(deleteBtn);

        // Append the new task container to the todo list
        document.getElementById('todoList').appendChild(newTask);

        // Clear the input field after adding the task
        inputField.value = "";

        // Add functionality to the delete button
        deleteBtn.addEventListener('click', function() {
            document.getElementById('todoList').removeChild(newTask);
        });
    }
});

